/**
 * Response from server
 */
export interface IFetchResponse extends Response {
    /**
     * HTTP status code
     */
    status: number;
    /**
     * HTTP headers
     */
    headers: Headers;
    /**
     * Data in arrayBuffer format
     */
    arrayBuffer(): Promise<ArrayBuffer>;
    /**
     * Data in json format
     */
    json(): Promise<any>;
    /**
     * Data in text format
     */
    text(): Promise<string>;
}
